import { useEffect } from "react";

const useSearchByBarcode = (barcode) => {
    // useEffect(() => {
        
        try {
        const response =  fetch("db/products");
        const data = response.json();

        // Search for object with provided barcode
        const result = data.find(item => item.barcode === barcode);
    } catch (error) {
        console.error('Error fetching data:', error);
    }
    // })

    
    return ;
}

export default useSearchByBarcode;
